int majority(int a, int b, int c) {
	return (a & b) ^ (b & c) ^ (c & a);
}
int parity(int reg) {
	reg ^= (reg >> 16);
	reg ^= (reg >> 8);
	reg ^= (reg >> 4);
	reg ^= (reg >> 2);
	reg ^= (reg >> 1);
	return reg & 1;
}
struct LFSR {
	int len = 0;
	int reg = 0;
	int fp;
	int ff;
	void clock() {
		reg <<= 1;
		int t = parity(reg & fp);
		reg = (reg & ff) ^ t;
	}
	int get(int idx) {
		return ((reg >> idx) & 1);
	}
};
void enc(int K[64], int N[19], int z[208]) {
	int a[64];
	for (int i = 0; i < 64; i++) a[i] = K[i];
	for (int i = 3; i <= 15; i++) a[i] = a[i] ^ N[i + 3];
	for (int i = 22; i <= 23; i++) a[i] = a[i] ^ N[i - 18];
	for (int i = 60; i <= 63; i++) a[i] = a[i] ^ N[i - 60];

	int aa[64];
	for (int i = 0; i < 4; i++) {
		for (int j = 0; j < 16; j++) aa[i * 16 + 15 - j] = a[i * 16 + j];
	}

	LFSR R1, R2, R3, R4;
	R1.len = 19;
	R2.len = 22;
	R3.len = 23;
	R4.len = 17;

	R1.fp = 0xE4000;
	R2.fp = 0x622000;
	R3.fp = 0xCC0000;
	R4.fp = 0x26200;

	R1.ff = 0x7FFFF;
	R2.ff = 0x3FFFFF;
	R3.ff = 0x7FFFFF;
	R4.ff = 0x1FFFF;
	for (int i = 0; i < 64; i++) {
		R1.clock();
		R2.clock();
		R3.clock();
		R4.clock();

		R1.reg ^= aa[i];
		R2.reg ^= aa[i];
		R3.reg ^= aa[i];
		R4.reg ^= aa[i];
	}
	R1.reg |= 1;
	R2.reg |= 1;
	R3.reg |= 1;
	R4.reg |= 1;

	for (int i = 0; i < discard+208; i++) {
		int maj = majority(R4.get(1), R4.get(6), R4.get(15));
		if (maj == R4.get(15)) R1.clock();
		if (maj == R4.get(6)) R2.clock();
		if (maj == R4.get(1)) R3.clock();

		if (i >= discard)
			z[i - discard] = majority(R1.get(1), R1.get(6), R1.get(15))
			^ majority(R2.get(3), R2.get(8), R2.get(14))
			^ majority(R3.get(4), R3.get(15), R3.get(19))
			^ R1.get(11) ^ R2.get(1) ^ R3.get(0);

		R4.clock();
	}
}

